description:
One of the best British underground neo psychedelic progressive rock groups of the late 90&amp;#039;s to come out of Leeds, perhaps too underground for their own good as they never signed a major record deal but had a large following of spores around the country. Extensive touring gave them energy and a freakout in their live sound quite unlike their peers always unfashionable and always unapologetic for it. Influenced by a real mix of bands; Hawkwind, Amon Duule 2, Can, Tangerine Dream, Jimi Hendrix, Big Black, Stooges, Velvet Underground, Pere Ubu, Neu!, Captain Beefheart and of course early Pink Floyd. They where born in the wrong era but still die hard hippies, substance abuse brought an untimely end to the band.


The Mushroom Gods are:

Lost Johnny        keyboard, vocals
Dick Freek         drums
Mathew Corbett     sitar, flute, effects
Fast Elbert Kram   guitar
CJD                Bass, vocals


